import React, { Component }from 'react';
import styled from 'styled-components';


import ProjectList from "../list_projects_page/ProjectList"
import ProjectFilters from "../list_projects_page/ProjectFilters"

const ContentWrap = styled.div`
display:flex;
justify-content:center;
align-items:center;
background-color: #dddddd;
`

class Content extends Component{
    render() {

        return (
            
            <ContentWrap>
                  <h1>Content</h1>
            {/* //     <ProjectList/>
            //     <ProjectFilters/> */}
             </ContentWrap>
        )

    }
}

export default Content
